@tooeffinlegit NIGHT RUN FEATURE OUT NOW. Link to my YouTube channel on my bio. ⚡️

This project was a big learning curve for my self. I’ve been consistently challenging my self with every video to enhance all my skills. Whether that be with lighting, angles, color grading , directing & post production it’s been a blast to see my work slowly grow. Thank you to @lolowmedia & @steezy_z30 for assisting in this piece. Very thankful for the opportunities that have come to my way because of filming & I’m excited to share all the coming projects debuting later this year. Hope you guys can check out the video, put a lot of work into it. 👊🏼

Happy Father’s Day as well! 🍻
